import{_ as d}from"./minimum_version_webui-0e3c3e77.js";import{_ as s}from"./paste-4bd1c89e.js";import{_ as c,r,o as u,c as h,a as e,b as o,d as a,w as n,e as i}from"./app-654e5f59.js";const p={},b=e("h1",{id:"часто-задаваемые-вопросы",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#часто-задаваемые-вопросы","aria-hidden":"true"},"#"),o(" Часто задаваемые вопросы")],-1),D=e("h3",{id:"вопрос-в-чем-разница-между-интерфеисом-перевода-без-ключа-api-и-интерфеисом-перевода-с-ключом-api",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#вопрос-в-чем-разница-между-интерфеисом-перевода-без-ключа-api-и-интерфеисом-перевода-с-ключом-api","aria-hidden":"true"},"#"),o(" Вопрос: В чем разница между интерфейсом перевода без ключа API и интерфейсом перевода с ключом API?")],-1),m=e("p",null,"Интерфейс перевода без ключа API получается с помощью веб-скрапинга и не требует от пользователей собственного ключа API. Однако в этом случае может возникнуть ситуация, когда перевод не удался. В таком случае стабильность будет низкой, скорость низкой, и интерфейс не будет поддерживать параллельные запросы. Интерфейс перевода с ключом API основан на вызове API-сервиса стороннего перевода, требующего от пользователей собственного ключа API. Однако вероятность успешного перевода выше, некоторые интерфейсы поддерживают высокую производительность и обеспечивают быструю скорость перевода.",-1),_=i(`<h3 id="вопрос-не-удается-использовать-службу-перевода-при-нажатии-кнопки-тест-появляется-сообщение-no-module-named-xxx" tabindex="-1"><a class="header-anchor" href="#вопрос-не-удается-использовать-службу-перевода-при-нажатии-кнопки-тест-появляется-сообщение-no-module-named-xxx" aria-hidden="true">#</a> Вопрос: Не удается использовать службу перевода, при нажатии кнопки &quot;Тест&quot; появляется сообщение &quot;No module named &#39;xxx&#39;&quot;?</h3><blockquote><p>Это происходит из-за неправильной установки зависимостей при запуске веб-интерфейса. Вы можете решить эту проблему следующим образом:</p><ol><li>Перейдите в каталог python/bin, используемый webui.</li><li>Выполните следующие команды:<div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code></code></pre><div class="line-numbers" aria-hidden="true"></div></div></li></ol><p>./python -m pip install chardet ./python -m pip install translators ./python -m pip install openai ./python -m pip install boto3 ./python -m pip install aliyun-python-sdk-core ./python -m pip install aliyun-python-sdk-alimt</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>3. После завершения установки перезапустите webui.

Подробнее см. [Установка пакетов](/ru/InstallationPackages.md)
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div></blockquote><h3 id="вопрос-ошибка-не-удалось-подключиться-к-службе-интерфеиса-на-заднем-плане-пожалуиста-вручную-обновите-страницу-если-это-не-помогло-перезапустите-webui" tabindex="-1"><a class="header-anchor" href="#вопрос-ошибка-не-удалось-подключиться-к-службе-интерфеиса-на-заднем-плане-пожалуиста-вручную-обновите-страницу-если-это-не-помогло-перезапустите-webui" aria-hidden="true">#</a> Вопрос: Ошибка &quot;Не удалось подключиться к службе интерфейса на заднем плане. Пожалуйста, вручную обновите страницу. Если это не помогло, перезапустите WebUI&quot;.</h3><blockquote><ul><li>Возможно, вам нужно обновить страницу или перезапустить WebUI.</li><li>Это происходит из-за неправильной установки зависимостей при запуске WebUI. См. выше, как установить модули.</li><li>Перейдите в каталог <code>extensions\\sd-webui-prompt-all-in-one\\storage</code> и измените кодировку файлов <code>history.*.json</code> и <code>favorite.*.json</code> на UTF-8 или удалите их (не забудьте сделать резервную копию).</li></ul></blockquote><h3 id="вопрос-почему-после-успешнои-установки-расширения-и-отсутствии-ошибок-в-консоли-веб-страница-все-еще-не-отображает-панель-расширения" tabindex="-1"><a class="header-anchor" href="#вопрос-почему-после-успешнои-установки-расширения-и-отсутствии-ошибок-в-консоли-веб-страница-все-еще-не-отображает-панель-расширения" aria-hidden="true">#</a> Вопрос: Почему после успешной установки расширения и отсутствии ошибок в консоли веб-страница все еще не отображает панель расширения?</h3>`,5),B={href:"https://github.com/AUTOMATIC1111/stable-diffusion-webui/commit/3715ece",target:"_blank",rel:"noopener noreferrer"},q=e("img",{src:d,alt:"",loading:"lazy"},null,-1),x=i('<h3 id="вопрос-я-не-нуждаюсь-в-службе-перевода-я-хочу-использовать-ее-в-автономнои-среде" tabindex="-1"><a class="header-anchor" href="#вопрос-я-не-нуждаюсь-в-службе-перевода-я-хочу-использовать-ее-в-автономнои-среде" aria-hidden="true">#</a> Вопрос: Я не нуждаюсь в службе перевода, я хочу использовать ее в автономной среде?</h3><blockquote><ol><li>При инициализации расширение устанавливает некоторые пакеты SDK для интерфейса перевода, такие как <code>translators</code>, <code>openai</code>, <code>boto3</code>, <code>aliyun-python-sdk-core</code>, <code>aliyun-python-sdk-alimt</code> и т. д. Если вам не нужна служба перевода и вы не хотите устанавливать эти пакеты, вручную откройте <code>install.py</code> и <code>scripts\\physton_prompt\\packages.py</code> и удалите код в соответствии с комментариями в коде. Это не повлияет на работу расширения. Затем снимите флажок с кнопки &quot;Автоматический перевод&quot; в настройках расширения.</li><li>Вы также можете изменить локальный язык на английский (<code>en_US</code>) в расширении, и все кнопки, связанные с переводом, будут скрыты. Хотя при инициализации расширение все равно установит эти пакеты SDK для интерфейса перевода, они импортируются по требованию в коде и не используют службу перевода, поэтому они не будут загружены.</li></ol></blockquote><h3 id="вопрос-почему-когда-я-вставляю-промпт-в-webui-он-не-автоматически-переводится-на-локальныи-язык-или-переводится-только-частично" tabindex="-1"><a class="header-anchor" href="#вопрос-почему-когда-я-вставляю-промпт-в-webui-он-не-автоматически-переводится-на-локальныи-язык-или-переводится-только-частично" aria-hidden="true">#</a> Вопрос: Почему, когда я вставляю промпт в WebUI, он не автоматически переводится на локальный язык или переводится только частично?</h3><blockquote><p>Когда вы вставляете промпт в WebUI, обычно это много ключевых слов, и автоматический перевод здесь потребует много сетевых запросов, поэтому расширение временно не включает функцию автоматического перевода в этой области. Если вам нужно, пожалуйста, вручную нажмите кнопку &quot;Пакетный перевод&quot;.</p><p>Если часть текста была переведена, это происходит потому, что вы включили функцию улучшения перевода tagcomplete в настройках перевода. Поскольку эта функция не требует сетевых запросов, она переводит все ключевые слова, которые может сопоставить.</p></blockquote><h3 id="вопрос-почему-некоторые-результаты-перевода-отображаются-как-0" tabindex="-1"><a class="header-anchor" href="#вопрос-почему-некоторые-результаты-перевода-отображаются-как-0" aria-hidden="true">#</a> Вопрос: Почему некоторые результаты перевода отображаются как &quot;0&quot;?</h3>',5),f=e("p",null,"Это происходит потому, что вы включили функцию улучшения перевода tagcomplete в настройках перевода, но вы не выбрали правильный CSV-файл. Правильный формат CSV-файла должен содержать индексные числа в первом столбце A, английские слова во втором столбце B и перевод на ваш локальный язык в третьем столбце C. Если формат CSV-файла неправильный, результат перевода будет равен 0.",-1),k={href:"https://github.com/Physton/sd-webui-prompt-all-in-one-assets/tree/main/tags",target:"_blank",rel:"noopener noreferrer"},g=e("p",null,'После выбора другого CSV-файла нажмите кнопку "Тест" внизу, чтобы проверить, правильно ли он переведен.',-1),y=i('<h3 id="вопрос-почему-под-кнопкои-создать-есть-две-кнопки-с-одинаковыми-описаниями" tabindex="-1"><a class="header-anchor" href="#вопрос-почему-под-кнопкои-создать-есть-две-кнопки-с-одинаковыми-описаниями" aria-hidden="true">#</a> Вопрос: Почему под кнопкой &quot;Создать&quot; есть две кнопки с одинаковыми описаниями?</h3><blockquote><p><img src="'+s+'" alt="" loading="lazy"></p><p>Первая кнопка является встроенной веб-интерфейсом и позволяет вам вставлять промпты из других источников или перетаскивать изображения в поле ввода веб-интерфейса. При нажатии на эту кнопку автоматически заполняются параметры в поле ввода веб-интерфейса.</p><p>Вторая кнопка добавлена этим расширением. Если вы скрыли встроенное поле ввода веб-интерфейса и не можете вставить содержимое в него, вы можете нажать вторую кнопку, вставить содержимое во всплывающем окне, а затем нажать &quot;Отправить&quot;, чтобы автоматически заполнить параметры в поле ввода веб-интерфейса. (Однако в настоящее время не поддерживается перетаскивание изображений)</p></blockquote><h3 id="вопрос-почему-некоторые-lora-и-lycoris-постоянно-мигают" tabindex="-1"><a class="header-anchor" href="#вопрос-почему-некоторые-lora-и-lycoris-постоянно-мигают" aria-hidden="true">#</a> Вопрос: Почему некоторые Lora и LyCORIS постоянно мигают?</h3><blockquote><p>Это происходит, когда модель Lora или LyCORIS не существует. Расширение предупреждает об этом, мигая.</p></blockquote><h3 id="вопрос-почему-раньше-было-две-кнопки-перевода-а-теперь-есть-только-одна" tabindex="-1"><a class="header-anchor" href="#вопрос-почему-раньше-было-две-кнопки-перевода-а-теперь-есть-только-одна" aria-hidden="true">#</a> Вопрос: Почему раньше было две кнопки перевода, а теперь есть только одна?</h3><blockquote><p>Теперь некоторые языки, такие как китайский, японский, корейский и т. д., поддерживают автоматическое распознавание вводимого вами текста на английском или локальном языке. Поэтому кнопки &quot;Перевести на английский&quot; и &quot;Перевести на локальный язык&quot; были объединены в одну кнопку. Независимо от того, вводите ли вы текст на английском или на локальном языке, он будет автоматически распознан и переведен.</p></blockquote><h3 id="вопрос-почему-это-расширение-не-имеет-номера-версии-и-описания-обновления" tabindex="-1"><a class="header-anchor" href="#вопрос-почему-это-расширение-не-имеет-номера-версии-и-описания-обновления" aria-hidden="true">#</a> Вопрос: Почему это расширение не имеет номера версии и описания обновления?</h3><blockquote><p>Это потому, что автор слишком ленив. Это расширение было выпущено недавно, и каждый день разрабатываются новые функции и исправляются ошибки. Большое количество журналов обновлений слишком громоздки. Поэтому, пожалуйста, регулярно обновляйте и исследуйте новые функции самостоятельно!</p></blockquote>',8);function I(v,A){const t=r("RouterLink"),l=r("ExternalLinkIcon");return u(),h("div",null,[b,D,e("blockquote",null,[m,e("p",null,[o("Подробнее см. "),a(t,{to:"/ru/TranslationApiConfiguration.html#%D0%9E%D0%BF%D0%B8%D1%81%D0%B0%D0%BD%D0%B8%D0%B5-%D0%B8%D0%BD%D1%82%D0%B5%D1%80%D1%84%D0%B5%D0%B9%D1%81%D0%B0-%D0%BF%D0%B5%D1%80%D0%B5%D0%B2%D0%BE%D0%B4%D0%B0"},{default:n(()=>[o("Описание интерфейса перевода")]),_:1})])]),_,e("blockquote",null,[e("p",null,[o("Убедитесь, что ваша версия WebUI является "),e("a",B,[o("3715ece (7-я неделя 2023 года)"),a(l)]),o(" или более поздняя. Если ваша версия WebUI ниже этой версии, вам нужно обновить WebUI. "),q]),e("p",null,[o("Подробнее см. "),a(t,{to:"/ru/Installation.html#%D0%9F%D1%80%D0%B8%D0%BC%D0%B5%D1%87%D0%B0%D0%BD%D0%B8%D1%8F"},{default:n(()=>[o("Примечания")]),_:1})])]),x,e("blockquote",null,[f,e("p",null,[o("Вы можете перейти по адресу "),e("a",k,[o("Physton/sd-webui-prompt-all-in-one-assets/tags"),a(l)]),o(", где я предоставил CSV-файл для китайского языка.")]),g,e("p",null,[o("Подробнее см. "),a(t,{to:"/ru/TranslationApiConfiguration.html#%D0%A3%D0%BB%D1%83%D1%87%D1%88%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9-%D0%BF%D0%B5%D1%80%D0%B5%D0%B2%D0%BE%D0%B4-tagcomplate"},{default:n(()=>[o("Улучшенный перевод TagComplate")]),_:1})])]),y])}const U=c(p,[["render",I],["__file","FAQ.html.vue"]]);export{U as default};
